import React, { useState } from 'react';
import { Box, Typography, Button } from '@mui/material';
import ProfileDisplay from './ProfileDisplay';
import PredictionResult from './PredictionResult';

const LinkedInInput = () => {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState(null);
  const [prediction, setPrediction] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validiere URL
    if (!url || !url.includes('linkedin.com/in/')) {
      setError('Bitte geben Sie eine gültige LinkedIn-Profil-URL ein (z.B. https://www.linkedin.com/in/username)');
      return;
    }

    setLoading(true);
    setError('');
    setProfile(null);
    setPrediction(null);

    try {
      // LinkedIn Profil abrufen
      const profileResponse = await fetch('/scrape-linkedin', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ url }),
      });

      if (!profileResponse.ok) {
        const errorData = await profileResponse.json();
        throw new Error(errorData.error || 'Fehler beim Laden des LinkedIn-Profils');
      }

      const profileData = await profileResponse.json();
      setProfile(profileData);

      // Formatiere die Erfahrungen für die Analyse
      const careerHistory = profileData.experience.map(exp => ({
        position: exp.title,
        company: exp.company,
        startDate: exp.duration.split(' - ')[0],
        endDate: exp.duration.split(' - ')[1] === 'Present' ? null : exp.duration.split(' - ')[1]
      }));

      // Karriere-Vorhersage
      const analysisResponse = await fetch('/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          experiences: careerHistory,
          modelType: 'tft'
        })
      });

      if (!analysisResponse.ok) {
        const errorData = await analysisResponse.json();
        throw new Error(errorData.error || 'Fehler bei der Karriere-Analyse');
      }

      const analysisData = await analysisResponse.json();
      setPrediction(analysisData);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ p: 4 }}>
      <Typography
        variant="h4"
        component="h1"
        sx={{
          color: '#0A1929',
          fontWeight: 700,
          mb: 2
        }}
      >
        LinkedIn Analyse
      </Typography>

      <Typography
        sx={{
          color: '#666',
          mb: 4,
          fontSize: '1.1rem'
        }}
      >
        Geben Sie einen LinkedIn-Profillink ein, um automatisch eine Karriereprognose basierend auf den verfügbaren Berufserfahrungen zu erstellen.
      </Typography>

      <Box
        className="form-group"
        sx={{
          bgcolor: 'white',
          borderRadius: 4,
          p: 4,
          boxShadow: '0 8px 25px rgba(0, 0, 0, 0.1)',
          mb: 4
        }}
      >
        <Typography
          variant="h6"
          sx={{
            color: '#0A1929',
            fontWeight: 600,
            mb: 3
          }}
        >
          LinkedIn Profil
        </Typography>

        <Box
          component="form"
          onSubmit={handleSubmit}
          sx={{
            display: 'flex',
            flexDirection: 'column',
            gap: 2
          }}
        >
          <Box className="linkedin-input-wrapper" sx={{ width: '100%' }}>
            <input
              type="url"
              value={url}
              onChange={(e) => setUrl(e.target.value)}
              placeholder="https://www.linkedin.com/in/beispiel-profil"
              required
              style={{
                width: '100%',
                padding: '12px 16px',
                border: '2px solid #e0e0e0',
                borderRadius: '8px',
                fontSize: '1rem',
                transition: 'all 0.3s ease',
                outline: 'none',
                boxSizing: 'border-box'
              }}
            />
          </Box>

          <Button
            type="submit"
            disabled={loading}
            sx={{
              width: '40%',
              margin: '0 auto',
              bgcolor: '#0A1929',
              color: 'white',
              border: 'none',
              padding: '14px',
              borderRadius: '8px',
              fontSize: '1rem',
              fontWeight: 600,
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              textTransform: 'none',
              '&:hover': {
                bgcolor: '#FF5F00',
                transform: 'translateY(-2px)'
              }
            }}
          >
            {loading ? 'Profil wird analysiert...' : 'Profil analysieren'}
          </Button>
        </Box>
      </Box>

      {loading && (
        <Box 
          className="loader-container-prediction"
          sx={{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',
            height: '150px',
            my: 4,
            gap: 2
          }}
        >
          <Box 
            className="loader-prediction"
            sx={{
              border: '4px solid #f3f3f3',
              borderTop: '4px solid #FF5F00',
              borderRadius: '50%',
              width: '40px',
              height: '40px',
              animation: 'spin 1s linear infinite',
              '@keyframes spin': {
                '0%': { transform: 'rotate(0deg)' },
                '100%': { transform: 'rotate(360deg)' }
              }
            }}
          />
          <Typography
            className="loader-status"
            sx={{
              color: '#0A1929',
              fontSize: '1.1rem',
              fontWeight: 500,
              textAlign: 'center'
            }}
          >
            Profil wird analysiert...
          </Typography>
        </Box>
      )}

      <Box id="profileContainer" sx={{ display: 'none' }} />
      <Box id="resultTableContainer" sx={{ display: 'none' }} />

      {error && (
        <Box
          sx={{
            bgcolor: '#fff3f3',
            border: '1px solid #ffcdd2',
            borderRadius: 2,
            p: 3,
            my: 3
          }}
        >
          <Typography variant="h6" sx={{ color: '#dc3545', mb: 1 }}>
            Fehler bei der Verarbeitung
          </Typography>
          <Typography sx={{ mb: 1 }}>{error}</Typography>
          <Typography variant="h6" sx={{ mt: 2, mb: 1 }}>Bitte überprüfen Sie:</Typography>
          <ul style={{ margin: 0, paddingLeft: 20 }}>
            <li>Stellen Sie sicher, dass die URL korrekt ist</li>
            <li>Das Profil muss öffentlich zugänglich sein</li>
            <li>Versuchen Sie es später erneut</li>
          </ul>
        </Box>
      )}

      {profile && <ProfileDisplay profile={profile} />}
      {prediction && <PredictionResult prediction={prediction} />}
    </Box>
  );
};

export default LinkedInInput;
